            (function() {
          var fn = function() {
            Bokeh.safely(function() {
              (function(root) {
                function embed_document(root) {
                  var docs_json = {"f26b6d5a-878f-4239-9b1a-3fa131cd1557":{"roots":{"references":[{"attributes":{"active":0,"callback":{"id":"42f45b2a-28a7-42bc-87b3-f14369f09805","type":"CustomJS"},"labels":["show Cluster","show Doublon","show Nans","show KaKs_Scores","show similarity_scores","show Length","show gc","show ecai","show cai"]},"id":"10f6ea34-d1a7-4939-b33c-9af7b9790b6e","type":"RadioButtonGroup"},{"attributes":{},"id":"a63f9c8e-4f9e-4903-bee6-3a7c6bc0e33e","type":"BasicTickFormatter"},{"attributes":{},"id":"b24962dd-9e2b-471b-a99a-677834173e1a","type":"BasicTickFormatter"},{"attributes":{"data_source":{"id":"845376e8-5d4f-433b-b102-f45632e35c4d","type":"ColumnDataSource"},"glyph":{"id":"dfb733fe-c882-4733-8443-da1de4fee245","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"fc054420-3584-4342-ae5f-29bdcb938017","type":"Circle"},"selection_glyph":null,"view":{"id":"b3460eab-ecd0-45a1-97d4-79ae8a92e400","type":"CDSView"}},"id":"63bfab8b-5f79-442b-ab36-f0b22ca4838c","type":"GlyphRenderer"},{"attributes":{"args":{"source":{"id":"845376e8-5d4f-433b-b102-f45632e35c4d","type":"ColumnDataSource"}},"code":"\n            // JavaScript code goes here\n            console.log(\"callback-------callback\");\n            var colors = ['#f39c12', \"#1abc9c\", \"#3498db\", \"#2ecc71\", \"#9b59b6\", '#34495e', '#492000', '#960019',\n'#043927', '#8F9779', '#f1c40f', '#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"42f45b2a-28a7-42bc-87b3-f14369f09805","type":"CustomJS"},{"attributes":{"plot":{"id":"3e5c68b9-7cbc-4ba1-bf47-ee60b8fdc32b","subtype":"Figure","type":"Plot"},"ticker":{"id":"68f7b096-e87e-42ad-b795-39bab8ea418f","type":"BasicTicker"}},"id":"3f5294af-895e-4d1f-9581-ede44f61a26d","type":"Grid"},{"attributes":{"children":[{"id":"7cb6f203-196a-4599-94a1-6a8877c7cfac","type":"WidgetBox"},{"id":"3e5c68b9-7cbc-4ba1-bf47-ee60b8fdc32b","subtype":"Figure","type":"Plot"}]},"id":"0b38b2b1-5f0c-4853-893b-6118afac2fa2","type":"Column"},{"attribut
